Double mongodb request in nodejs<p>Hi i have two requests i need in my app
but only one send a result, how can i do to make them both work?
the first one is a get of all my buildings, the second one is the same get but i sort the whole document  by campusName.</p>

<p>i did like that but still not working only one request sent.</p>

<pre><code>app.get('/buildings', async (req, res) =&gt; {
    try {
        await db.db('').collection('buildings').find({}).toArray(function (err, result) {
            res.send(result);
    });
        await db.db('').collection('buildings').aggregate([
        {$group : {_id: "$campusName", buildings : {$push : {buildingName : "$buildingName", phoneNumber :"$phoneNumber" }}}}
        ]).toArray(function (err, building) {
            res.send(building);
    });        
        } catch(err) {
            return res.json({
                         success: false,
                         message: 'error'
    });
        }
    });
</code></pre>

<p>that's my new query</p>

<pre><code>app.get('/buildings', async (req, res) =&gt; {
    try {
        await db.db('').collection('buildings').find({}).toArray(async (err, result) =&gt; {


        await db.db('').collection('buildings').aggregate([
        {$group : {_id: "$campusName", buildings : {$push : {buildingName : "$buildingName", phoneNumber :"$phoneNumber" }}}}
        ]).toArray((err, building) =&gt; {
            res.send(result);
            res.send(building);
        });  
    });      
        } catch(err) {
            return res.json({
                         success: false,
                         message: 'error'
    });
        }
    });
</code></pre>

<p>Finally what i did is separate the two queries in two adresses  like this and is=t's better for me to handle and manipulate on my front-end </p>

<pre><code>app.get('/buildings', async (req, res) =&gt; {
    try{
        await db.db('').collection('buildings').find({}).toArray(function (err, result) {
            res.send(result);
    });
        } catch(err) {
        return res.json({
                     success: false,
                     message: 'error'
                 });
        }
    });

app.get('/buildings/percampus', async (req, res) =&gt; {
    try {
        await db.db('').collection('buildings').aggregate([
        {$group : {_id: "$campusName", buildings : {$push : {buildingName : "$buildingName", phoneNumber :"$phoneNumber" }}}}
      ]).toArray(function (err, building) {
            res.send(building);
    });
        } catch(err) {
        return res.json({
                     success: false,
                     message: 'error'
                 }); 
        }

    });
</code></pre>

