NodeJS MongoDB Projection not working<p>I made a findOneAndUpdate on NodeJS with the following Code</p>

<pre><code>var themessageid = "ID of message A"
workstreamchat.findOneAndUpdate(
    { 'chat.sidmessage': themessageid }, 
    { '$set': { 
        'chat.$.linkinfo': linkinfo 
    } }, 
    { returnOriginal: false }, 
    function(err, res) {
        console.log(res);            
    }
);
</code></pre>

<p>e.g of document returned</p>

<pre><code>{
    "_id": "mongoid",
    "chat": [
        {
            "sidmessage": "id_of_message_A",
            "usersid": "38jrc05h14avm14e",
            "messageinfo": {
                "text": "Message A"
            }, 
            "linkinfo": "something" 
        },
        {
            "sidmessage": "id_of_message_B",
            "usersid": "38jrc05h14avm14e",
            "messageinfo": {
                "text": "MessageB"
            }
        }
    ]
}
</code></pre>

<p>It works flawlessly and returns the updated document with the updated specific object in the whole array.</p>

<p>The problem is I wanted to use projection to return the chat array only with the updated document. I have tried</p>

<pre><code>{ projection: { 'chat.$': 1 }, returnOriginal: false }
</code></pre>

<p>and</p>

<pre><code>{ projection: { chat: chat.$ }, returnOriginal: false }
</code></pre>

<p>But everytime this kind of projection with <code>returnOriginal</code> returns null.</p>

<p>e.g of expected document</p>

<pre><code>{
    "_id": "mongoid", 
    "chat": [
        {
            "sidmessage": "id_of_message_A",
            "usersid": "38jrc05h14avm14e",
            "messageinfo": {
                "text": "Message A"
            },
            "linkinfo": "something"
        }
    ],
}
</code></pre>

