<p>The <a href="http://mongodb.github.io/node-mongodb-native/2.1/api/Collection.html#findOneAndUpdate" rel="nofollow noreferrer">documentation</a> I am using.</p>

<p>My npm version is 6.4.0</p>

<p>My MongoDB driver version is 3.1.4</p>

