How to validate array length when using $push?<p>I'm trying to limit the amount of elements a user can add to an array field on one of my schemas. I'm currently adding the elements to the array using <code>Schema.findOneAndUpdate();</code> with the <code>$push</code> operator. </p>

<p>The first thing I tried was the solution given by another answer here on StackOverflow, namely: <a href="https://stackoverflow.com/a/29418656/6502807">https://stackoverflow.com/a/29418656/6502807</a>
This solution adds a validate function to the fields in the schema definition. By setting <code>runValidators</code> to true, I did get the function to run with <code>Schema.findOneAndUpdate()</code>. It was at that moment, however, that I stumbled upon the next problem. At the end of the Validation chapter in the Mongoose docs it says: </p>

<blockquote>
  <p>Also, $push, $addToSet, $pull, and $pullAll validation does not run any validation on the array itself, only individual elements of the array.</p>
</blockquote>

<p>So attempting to check for array length did not work when using <code>$pull</code>. It simply supplied the validation function with an empty array every time, regardless of its actual contents in the database.</p>

<p>Next thing I tried was to use a <code>pre</code> hook. This was without any success as well. For some reason it did not execute the hook, even with <code>runValidators</code> set to true. This is how I defined said hook:</p>

<pre><code>Settings.pre('update', async function (next) {
    if (this.messages.length &gt; MAX_MESSAGES) {
        throw new Error('Too many messages');
    } else {
        next();
    }
});
</code></pre>

<p><strong>EDIT:</strong> The reason the function did not fire was because I was using <code>findOneAndUpdate</code> instead of <code>update</code> this is fixed and the function now runs. The solution code above, however, does not work.</p>

<p>The schema with the array looks like this:</p>

<pre><code>const Settings = new mongoose.Schema({
    // A lot more fields not relevant to this question
