Can a node app connect / write to MongoDB while being run as PM2 service?<p>I have this Node app here, which makes a request to an api to get some stock data, loops through that stock data and then writes it to a Mongo DB every 5 minutes. I am running it on a Digital Ocean server with PM2 as a service. However, after letting it run a for a day I don't see any data in the DB. I don't see any signs that the service wasn't running or had any errors so I'm wondering if maybe it is because a PM 2 service can't write to the DB? Maybe a ports issue? Any guidance would be awesome!</p>

<pre><code>// -- Dependancies --
// Request and MongoDB
const request = require('request');
const mongoose = require('mongoose');
const Schema = mongoose.Schema;


// Connect to database
mongoose.connect('mongodb://127.0.0.1:27017/stock-test')
    .then(() =&gt; {
        console.log('connected');
    })
    .catch(err =&gt; {
        console.error(err);
    });


// Setup stockMoment Schema
const StockMomentSchema = new Schema({
    symbol: String,
    price: Number,
    size: Number,
    time: {type: Date, default: Date.now}
});


// Create stockMoment model
StockMoment = mongoose.model('stockMoment', StockMomentSchema, 'stockPriceData');


// Setup Variables
const d = new Date();
let day = d.getDay()
let hour = d.getHours();



// Check time, run getMarketData function if market is open
function makeRequest() {
    if(day &gt;= 1 &amp;&amp; day &lt;= 5) {
        if(hour &gt;= 11 &amp;&amp; hour &lt;= 16) {
            getMarketData();
        }
    }
}


// Run request to get data, store data in MongoDB database
function getMarketData() {
    request({
        url: 'https://api.iextrading.com/1.0/tops/last',
        json: true
    }, (err, res, body) =&gt; {
        if(err) {
            return console.error(err);
        }

        for(let i = 0; i &lt; body.length; i++) {
            const stockMoment = new StockMoment({
                symbol: body[i].symbol,
                price: body[i].price,
                size: body[i].size,
                time: body[i].time,
            });
            stockMoment.save((err) =&gt; {
                if(err) return handleError(err);
                console.log('Saved!', i);
            });
            console.log(body[i]);
        }
    });
}


setInterval(makeRequest, 300000);
</code></pre>

